const Celebrity = (prob) => {
    let celeb = prob.datas
    return (
        <div>
            {celeb.map((x)=>(
                <div className="container">
                    <div className="images">
                    <img src={x.image} alt="" />
                    </div>
                </div>
            ))}
        </div>


    );
}

export default Celebrity;
